# You are given a string s.You can convert s to a palindrome by adding characters in front of it.
# Return the shortest palindrome you can find by performing this transformation.
#
# Example 1:
# Input: s = "aacecaaa"
# Output: "aaacecaaa"

# Example 2:
# Input: s = "abcd"
# Output: "dcbabcd"
#
# Constraints:
#
# 0 <= s.length <= 5 * 104
# s consists of lowercase English letters only.

def solution(str):
    if len(str) == 1:
        return str

    i = len(str)
    longest_palindrome = 0

    while i > 0:
        if is_palindrome(str[0:i]):
            break
        i -= 1

    if i > 0:
        longest_palindrome = i -1

    print("length of str: ", len(str))

    print("longest_palindrome:", longest_palindrome,", i= ", i)

    if longest_palindrome == len(str) - 1:
        return str

    palindrome_str = str[0:longest_palindrome+1]
    append_left = str[longest_palindrome+1:len(str)][::-1]

    print("palindrome str: ", palindrome_str)
    print("append_left:", append_left)

    result = append_left + str

    return result


def is_palindrome(str):
    i = 0
    j = len(str) - 1

    while i <= j:
        if str[i] == str[j]:
            i += 1
            j -= 1
        else:
            break

    return i >= j


def solution2(s):
    length = len(s)
    reversed_string = s[::-1]  # Reverse the string

    # Iterate through the string to find the longest palindromic prefix
    for i in range(length):
        if s[: length - i] == reversed_string[i:]:
            return reversed_string[:i] + s
    return ""


if __name__ == "__main__":

    assert "a" == solution("a")

    assert "aba" == solution("aba")

    assert "aaacecaaa" == solution("aacecaaa")

    assert "dcbabcd" == solution("abcd")

    # assert "" == solution("")